import React from 'react'

function Modal({ currentPhoto }) {
    const { name, catagory, description, index } = currentPhoto

    return(
        <>
        <div className="modalBackdrop">
            <div className="modalContainer">
                <h3 className="modalTitle">{name}</h3>
                <image src={require(`../../assets/large/${catagory}/${index}.jpg`)} alt="Current catagory" />
                <p>{description}</p>
                <button type="button" >
                    close this modal
                </button>
            </div>
        </div>
        </>//jsx
    );
}

export default Modal;
